import Layout from '../../comps/Layout';
import Link from 'next/link';

const PostLink = (props) => {
    const {title} = props;

    return (
        <li>
            <Link href={`/blog/post?title=${title}`}>
                <a>{title}</a>
            </Link>
        </li>
    )
}

export default () => {

    return (
        <Layout>
            <div>
            <h1>My Blog</h1>
            <p> welcome to blog </p>
                <ul>
                    <li> 
                        <Link href={`/blog/post?id=`}> 
                            <a> Hello next js </a> 
                        </Link>
                    </li>

                </ul>
            </div>
        </Layout>
    )
}
